import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Page1 from './components/Page1/Page1';
import Page2 from './components/Page2/Page2';
import React from 'react'
import Propertyinfo from './components/Property/Propertyinfo';
import Locdialog from './components/Page2/Locdialog';

function App() {
  const [cname, setcname] = React.useState('');
  const [loc, setloc] = React.useState('');
  const [propertyData, setPropertyData] = React.useState(null);
  const [agencyData, setAgencyData]=React.useState(null);

  return (
    <>
      <div className="App" id='outerouter'>

        <div className='outermainpg'>
          <div className='uppermainpg'>
            Hello {cname} !
          </div>
          <div className='lowermainpg'>

            <BrowserRouter>
              <Routes>
                <Route path='/' element={<Page1 cname={cname} setcname={setcname}/>}></Route>
                <Route path='/select' element={<Page2 loc={loc} setloc={setloc} propertyData={propertyData} setPropertyData={setPropertyData}/>}></Route>
                <Route path='/propertyinfo' element={<Propertyinfo data={propertyData}></Propertyinfo>}></Route>
                <Route path='/agencyinfo' element={<Locdialog loc={loc} setloc={setloc} cname={cname}></Locdialog>}></Route>
              </Routes>
            </BrowserRouter>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
